import User from '../User'
import './team.css'

const Team = (props) => {

    const SecColor = { backgroundColor: props.secundarycolor }
    const PriColor = { borderColor: props.primarycolor }

    return (

        <section className='team' style={SecColor}>
            <h3 style={PriColor}>{props.name}</h3>
            {props.Users.map(user => <User name ={user.name} office ={user.office} image = {user.image} phone = {user.phone}/>)}
        </section>
    )
}

export default Team
